import fire from '../../config/firebase';

class Header extends Component{
    constructor(props){
        super(props)
        this.setState={}

       this.logout = () => {
            fire.auth().signOut()
            .then(() => this.props.history.push('/login'))
            .catch( error => error );
        }
    }

    render(){
        return(
            <div>
                <p>oi</p>
            <button onClick={this.logout}>sair</button>
            </div>
        )
    }
}

